import React from "react";
import "./style.css";

function Contact(props) {
  return (
    <div class="contact">
      <h1 class="xxlarge">contact me</h1>
      <hr />
      <button class="soundNav ">Email</button>
      <button class="soundNav">class="contactDivs">GitHub</button>
      <button class="soundNav">Resume (PDF)</button>
      <button class="soundNav">
        LinkedIn<i
          class="fa fa-linkedin"
        ></i>
      </button>
    </div>
  );
}

export default Contact;
